import React from 'react';
import { Button } from '@mui/material';
import '../styles/ControlPanel.css';

const ControlPanel = () => {
    return (
        <div className="control-panel">
            <h2>Control Panel</h2>
            <Button variant="contained" color="primary">Optimize Routes</Button>
            <Button variant="contained" color="secondary">Refresh Data</Button>
            <Button variant="contained" color="warning">Send Alert</Button>
        </div>
    );
};

export default ControlPanel;
